import { useContext } from 'react';
import ShoesContext
 from '../context/shoes';
import CartItem from './CartItem';
import Button from './Button';

function Cart() {
  const { cart, quantity } = useContext(ShoesContext);

  const renderedItems = cart.map(product => {
    return(
      <CartItem name={product.name} price={product.price} quantity={quantity} />
    )
  })
  return(
    <div>
      <h1>Cart</h1>
      {renderedItems}
      <Button className="orange-btn">Checkout</Button>
    </div>
  )
}

export default Cart;
